import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Find and click on a product to open its detail view
    // Using a product with a unique title for a stable selector
    const productCardLocator = page.locator('.product-card', { hasText: 'Sony WH-1000XM5 Wireless Noise Canceling Headphones' });
    await productCardLocator.waitFor({ state: 'visible', timeout: 5000 });
    await productCardLocator.click();

    // 2. Wait for the product detail modal to appear
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Click the "Add to Wish List" button inside the modal
    const addToWishlistButton = page.locator('.add-to-wishlist');
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification and extract its text
    const notificationLocator = page.locator('.notification.success');
    await notificationLocator.waitFor({ state: 'visible', timeout: 5000 });
    const notificationText = await notificationLocator.textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    return {
      success: true,
      action: "Successfully added a product to the wishlist.",
      extractedData: {
        confirmationMessage: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        console.error("Failed to take error screenshot:", e);
    }

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
